PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE npc (
    id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    family TEXT NULL,
    zone TEXT NOT NULL
);
CREATE TABLE player (
    id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    family TEXT NULL,
    zone TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "monster" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"name"	TEXT NOT NULL,
	"family"	TEXT,
	"job"	TEXT,
	"zone"	TEXT NOT NULL,
	"is_aggressive"	INTEGER NOT NULL DEFAULT 0,
	"is_linking"	INTEGER NOT NULL DEFAULT 0,
	"is_nm"	INTEGER NOT NULL DEFAULT 0,
	"is_fishing"	INTEGER NOT NULL DEFAULT 0,
	"level_min"	INTEGER,
	"level_max"	INTEGER,
	"detects_sight"	INTEGER NOT NULL DEFAULT 0,
	"detects_sound"	INTEGER NOT NULL DEFAULT 0,
	"detects_magic"	INTEGER NOT NULL DEFAULT 0,
	"detects_lowhp"	INTEGER NOT NULL DEFAULT 0,
	"detects_healing"	INTEGER NOT NULL DEFAULT 0,
	"detects_truesight"	INTEGER NOT NULL DEFAULT 0,
	"detects_truesound"	INTEGER NOT NULL DEFAULT 0,
	"tracks_scent"	INTEGER NOT NULL DEFAULT 0,
	"weaknesses"	TEXT,
	"resistances"	TEXT,
	"immunities"	TEXT,
	"drops"	TEXT,
	"stolen"	TEXT,
	"spawn_count"	INT,
	"spawn_time"	TEXT,
	"somepage_id"	TEXT,
	"atlas_id"	TEXT,
	"ffxiclopedia_id"	TEXT,
	"allakhazam_id"	TEXT
);
DELETE FROM sqlite_sequence;
CREATE INDEX npc__zone__name ON npc(zone, name, id);
CREATE INDEX player__zone__name ON player (zone, name, id);
CREATE INDEX "monster__zone__name" ON "monster" (
	"zone",
	"name",
	"id"
);
CREATE INDEX "monster__name" ON "monster" (
	"name"
);
COMMIT;
